import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '.styled-components';

function Menu() {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
      <Navbar.Brand href="/">My Website</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ms-auto">
          <Nav.Link as={Link} to="/">Home</Nav.Link>
          <NavDropdown title="Fitness" id="basic-nav-dropdown">
            <NavDropdown.Item as={Link} to="/fitness/antrenament">Antrenament</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/fitness/diete">Diete</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/fitness/apel-de-consultanta">Apel de consultanță</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
          <Nav.Link as={Link} to="/login">Login</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Menu;
